import React from 'react';
import { Jumbotron, ExampleToast } from 'react-bootstrap';


const HeaderPokemon = props => {
  return
  <Jumbotron>
    <h1>Olá mundo com bootstrap</h1>
  </Jumbotron>
}

function App() {
  return (
    <div className='App'>
      <HeaderPokemon />
    </div>
  );
}

export default App;
